  \"access_constraints\",\n\t\t\"value\": \"[\"Use Constraints: This data set was
  digitized from a map published at a scale of 1:250,000. The map represents the elevation
  of the water levels in the alluvial and terrace deposits along the Cimarron River
  from Freedom to Guthrie, Oklahoma, in 1985-86.Water-level elevations represented
  at this scale are indicative of broad, regional trends and should not be interpreted
